import React from 'react';
import {Navbar,Nav,NavDropdown,Button} from 'react-bootstrap';
import {Link} from 'react-router-dom';
export default class NavigationBar extends React.Component{
	render(){
		return (
				<Navbar bg="dark" variant="dark">
				<Navbar.Brand onClick={this.props.viewAction}>NeoLife Boutique</Navbar.Brand>
				<Navbar.Collapse id="basic-navbar-nav">
					{/* <Nav className="mr-auto">
						<Link to={"/"} className="nav-link">Dashboard</Link>
						<Link to={"orderProduct"} className="nav-link">Order Prouduct</Link>
						<Link to={"viewProduct"} className="nav-link">View Product</Link>
						<Link to={"viewEmployee"} className="nav-link">View Employee</Link>
						<Link to={"importSales"} className="nav-link">Import Sales</Link>
						<NavDropdown title="View Report" id="basic-nav-dropdown">
							<NavDropdown.Item as={Link} to={"/"}>Monthly Sales Report - Brand</NavDropdown.Item>
							<NavDropdown.Divider />
							<NavDropdown.Item as={Link} to={"/"}>Monthly Sales Report - Product</NavDropdown.Item>
							<NavDropdown.Divider />
							<NavDropdown.Item as={Link} to={"/"}>Monthly Sales Report - Employee</NavDropdown.Item>
						</NavDropdown>
					</Nav> */}
					{
						this.props.navItems.map((item)=>{
							item.child == null ?
						<Link to={item.url} className="nav-link">{item.name}</Link> :
						<NavDropdown title={item.name} id="basic-nav-dropdown">
							{
								item.child.map((childItem)=>{
								<NavDropdown.Item as={Link} to={childItem.url}>{childItem.name}</NavDropdown.Item>	
								})
							}

						</NavDropdown>

						})
					}
				</Navbar.Collapse>
				</Navbar>
         );
	}
}
